import { Route, Switch } from "react-router-dom";

function App() {
  return (
    <div>
      <Switch>
        <Route path="/quotes"></Route>
        <Route path="/quotes/:quoteId"></Route>
      </Switch>
      <Route path="/new-quote"></Route>
    </div>
  );
}

export default App;
